import React, { useState } from "react";
import Paper from "@mui/material/Paper";
import { Box, Stack } from '@mui/material';
import Typography from '@mui/material/Typography';
import FlashcardList from "../FlashcardList";

const flashcard_comp = [
    {
      id: 1,
      project_name: "Data Assistant",
      details: "A personal project I did to learn React and MUI.",
      additional: "I spent time outside of my internship to design and implement features that were visually appealing and to my liking.",
      pills: ["React", "JSX", "MUI", "CSS"],
    },
    {
      id: 2,
      project_name: "Data Science Intern at MISO Energy",
      additional: "I worked on creating the visualization for Michigan, where I had to clean the data from scratch and make an eye-catchng visualization.",
      details: "Worked in a group of 5 to create a data visualization of opioid overdose data.",
      pills: ["Tableau", "Python", "Excel", "Wix"],
      relevant_course: ["Data Visualization", "Python Programming"]
    },
  ];

export default function Work() {
    const [flashcards, setFlashcards] = useState(flashcard_comp);

return(
    <div>
      <Stack>
              <Box
                sx={{
                  bgcolor: "#b5b5b5",
                  borderRadius: 2,
                  width: 800,
                  height: 250,
                }}
              >
                <div class="container">
                  <div class="circle1"></div>
                  <div class="circle2"></div>
                  <div class="circle3"></div>
                </div>
                <Paper
                  elevation={3}
                  sx={{
                    bgcolor: "white",
                    borderRadius: 1,
                    height: 700,
                    fontSize: 24,
                    p: 2
                  }}
                >
                  <br />
                  <Typography variant="h2"> Experience </Typography>
                  <br/>
                  <br/>
                  <FlashcardList flashcards={flashcards}/>
                </Paper>
              </Box>
        </Stack>
      </div>
);
  }
